import React, { useState, useEffect } from "react";
import {
  WhyMethodContainer,
  Container,
  TitleGroup,
  Title,
  BenefitsList,
  BenefitItem,
  BenefitIcon,
  BenefitText,
  Grid,
  FloatingCard,
  VideoContainer,
  VideoEmbed,
  VideoPlaceholder,
  VideoTitle,
  LiveBadge,
} from "./styles";

function WhyMethodWorks() {
  const [visibleElements, setVisibleElements] = useState(new Set());

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            setVisibleElements((prev) => new Set([...prev, entry.target.id]));
          }
        });
      },
      { threshold: 0.2 }
    );

    const elements = document.querySelectorAll("[data-animate]");
    elements.forEach((el, index) => {
      el.id = `element-${index}`;
      observer.observe(el);
    });

    return () => observer.disconnect();
  }, []);

  const benefits = [
    {
      icon: "üìä",
      text: "Aloca√ß√£o baseada em juros reais e ciclo econ√¥mico",
      bgColor: "#3b82f6",
      bgColorSecondary: "#1d4ed8",
    },
    {
      icon: "üõ°Ô∏è",
      text: "Estrat√©gia de liquidez e prote√ß√£o de capital",
      bgColor: "#fbbf24",
      bgColorSecondary: "#f59e0b",
    },
    {
      icon: "üéØ",
      text: "Tomada de decis√£o fria e sem ru√≠do",
      bgColor: "#ec4899",
      bgColorSecondary: "#be185d",
    },
    {
      icon: "üåç",
      text: "Diversifica√ß√£o global com racionalidade",
      bgColor: "#06b6d4",
      bgColorSecondary: "#0891b2",
    },
  ];

  const videoIds = ["dQw4w9WgXcQ", "ysz5S6PUM-U", "Zi_XLOBDo_Y", "KT7F9gEfhRU"];

  const videoTitles = [
    "Fundamentos do Estoicismo Financeiro",
    "Estrat√©gias de Aloca√ß√£o Inteligente",
    "Prote√ß√£o Patrimonial na Pr√°tica",
    "Diversifica√ß√£o Global Estrat√©gica",
  ];

  type VideoEmbedComponentProps = {
    id: string;
    title: string;
    index: number;
  };

  const VideoEmbedComponent: React.FC<VideoEmbedComponentProps> = ({
    id,
    title,
    index,
  }) => {
    const [isLoaded, setIsLoaded] = useState(false);

    return (
      <div c>
        <FloatingCard
          data-animate
          className={
            visibleElements.has(`element-${4 + index}`) ? "visible" : ""
          }
        >
          <VideoContainer>
            {index === 0 && <LiveBadge>üî¥ Ao Vivo</LiveBadge>}
            {isLoaded ? (
              <VideoEmbed
                src={`https://www.youtube.com/embed/${id}?rel=0&showinfo=0&modestbranding=1`}
                title={title}
                allowFullScreen
              />
            ) : (
              <VideoPlaceholder onClick={() => setIsLoaded(true)}>
                <div style={{ fontSize: "4rem", marginBottom: "0.5rem" }}>
                  ‚ñ∂Ô∏è
                </div>
                <div
                  style={{
                    fontSize: "1rem",
                    textAlign: "center",
                    padding: "0 1rem",
                  }}
                >
                  Clique para carregar
                </div>
              </VideoPlaceholder>
            )}
          </VideoContainer>
          <VideoTitle>{title}</VideoTitle>
        </FloatingCard>
      </div>
    );
  };

  return (
    <div className="container">
      <WhyMethodContainer>
        <Container>
          <TitleGroup>
            <Title>Por que este m√©todo funciona?</Title>
          </TitleGroup>

          <BenefitsList>
            {benefits.map((benefit, index) => (
              <BenefitItem
                key={index}
                data-animate
                className={
                  visibleElements.has(`element-${index}`) ? "visible" : ""
                }
              >
                <BenefitIcon
                  bgColor={benefit.bgColor}
                  bgColorSecondary={benefit.bgColorSecondary}
                >
                  {benefit.icon}
                </BenefitIcon>
                <BenefitText>{benefit.text}</BenefitText>
              </BenefitItem>
            ))}
          </BenefitsList>

          <Grid>
            {videoIds.map((id, index) => (
              <VideoEmbedComponent
                key={id}
                id={id}
                title={videoTitles[index]}
                index={index}
              />
            ))}
          </Grid>
        </Container>
      </WhyMethodContainer>
    </div>
  );
}

export default WhyMethodWorks;
